	/**
	 * @return the refAcc
	 */
	public String getRefAcc() {
		if(refAcc != null)
			return refAcc;
		
		if(altAcNo == null || altAcNo.isEmpty()) return null;
		
		if(altAcNo.indexOf("-")>0) {
			refAcc = altAcNo;
			return refAcc;
		}
		
		refAcc = new StringBuilder().append(altAcNo.substring(0, 4)).append("-").append(altAcNo.substring(4, 10)).append("-").append(altAcNo.substring(10)).toString();
		return refAcc;
	}

	/**
	 * @param refAcc the refAcc to set
	 */
	public void setRefAcc(String refAcc) {
		this.refAcc = refAcc;
	}
	
	@Transient
	String accountTypeFull;

	public String getAccountTypeFull() {
		if(accountTypeFull == null)
		{
			if(accountType.equals("S")){
				accountTypeFull = "Single";
			}
			else if(accountType.equals("J")){
				accountTypeFull = "Joint";
			}
			else if(accountType.equals("G")){
				accountTypeFull = "Group";
			}
			
		}
		return accountTypeFull;
	}

	public void setAccountTypeFull(String accountTypeFull) {
		this.accountTypeFull = accountTypeFull;
	}

